import { Button } from "@mui/material"
import classes from './ProjectList.module.css'
import React from "react"
export interface IProps{
    id:string,
    name:string,
    staff:string,
    client:string,
    statusId:boolean

}
const ProjectList : React.FC<{onProps:IProps[]}>=(props)=>{
return (
    <div >
       
    <ul >
    <div >{props.onProps.map((item:any, index)=>{
        
    return  <li className={classes.specificproject} key={index}>
     <div className={classes.allBody}><Button > {`שם: ${item.name}`} {`מפתח: ${item.staff}`} {`לקוח: ${item.client}`} {`סטטוס: ${item.statusId}`}לפרוייקט לחץ כאן  </Button></div>

</li>
    })}</div>
    </ul>
    </div>
)
}

export default ProjectList
